import "./App.css";

/**
 * Header
 * - Logo
 * - Nav Items (Right Side)
 * - Car
 *
 * Body
 * - Search Bar
 * - RestaurantCard
 *    - Image
 *    - Name
 *    - Rating
 *    - Cuisines
 *
 * Footer
 *    - links
 *    - copyright
 */
const Title = () => {
  // return <h1 className="header-name">HungryFoods</h1>;
  return (
    <a href="/">
      <img className="logo" src="hungry-foods-logo.png" alt="app logo" />
    </a>
  );
};

const AppLayout = () => {
  return (
    <>
      <Header />
      <Body />
      <Footer />
    </>
  )
}

function App() {
  return (
    <div className="App-header">
      <Title />
      <div className="nav-items">
        <ul>
          <li>Home</li>
          <li>Aobut</li>
          <li>Contact</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
